import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Layout from './components/Layout/Layout';
import Home from './pages/Home';
import About from './pages/About';
import Contact from './pages/Contact'; // Import Contact page
import Academics from './pages/Academics'; // Import Academics page
import Admissions from './pages/Admissions'; // Import Admissions page

function App() {
  return (
    <Router>
      <Layout>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} /> {/* Add Contact route */}
          <Route path="/academics" element={<Academics />} /> {/* Add Academics route */}
          <Route path="/admissions" element={<Admissions />} /> {/* Add Admissions route */}
        </Routes>
      </Layout>
    </Router>
  );
}

export default App;
